const WebSocketInstance = new WebSocket("ws://127.0.0.1:8000/ws/chat/");

WebSocketInstance.onopen = () => {
    console.log("WebSocket connected");
};

WebSocketInstance.onerror = (error) => {
    console.error("WebSocket error:", error);
};
